import { useEffect, useState } from 'react';
import Park from './Park';
import useFetch from './useFetch';
import { Link } from 'react-router-dom';
import { useParams } from "react-router";

const ActivityList = () => {
    const { activityId } = useParams();

    const { data: activity, isPending, error } = useFetch("https://developer.nps.gov/api/v1/activities/parks?id="+activityId+"&limit=500&api_key=gUeSemHr93mXuKE5WqakVIaO2cDN67aqXettWyDE");
    console.log(activity);
    //console.log(parks);
    //const parks = data;
    //const [Activities, setActivities] = useState([]);

    /*const handleActivitySearch = (activity) => {
        const newParks = parks.filter(park => park.activities !== activity);
        setParks(newParks);
    }*/
    return (
        <div className="park-list">
            { error && <div>{ error }</div> }
            { isPending && <div>Loading...</div> }
            { activity && (activity.data[0].parks.map(function(parks, idx){
                {parks.map(function(park, idx){
                    <Link to={`/Parks/${park.parkCode}`}> <li key={idx}>{park.parkCode}</li>
                        <h2> { activity.data[0].name } </h2>
                        <h3> { park.fullName } </h3>
                        <Park parkCode={park.parkCode} />
                    </Link>
                })}
            }))}
        </div>
    )
}

export default ActivityList;
